import {React, useState} from "react"
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome"
import {  faBars } from "@fortawesome/free-solid-svg-icons"
import '../css/navbar.css'

export default function Navbar(props){

    const { data , toggle } = props

    /** this function handles the openening the of the nav menu */
    function handleOnNavClick(){
        return(
            console.log("Menu Clicked")
        )
    }


    return (
        <nav className="navigation">
            <img className="navigation-logo" src="../../images/mandala.png" alt="logo" />
            <FontAwesomeIcon onClick={(handleOnNavClick)} className="navigation-bar" icon={faBars}/>

            <ul className="navigation-list">
                {data.map(item => {
                    return <li className="navigation-item" key={item.id} onClick={() => toggle(false, item.id)}>{item.nav_str}</li>
                })}
            </ul>
        </nav>
    )
}
